import { signInWithGooglePopup, signInWithGoogleRedirect, createUserDocumentFromAuth } from "../../../utils/firebase/firebase.utils.js";

const signIn=()=>{
    const logGoogleUser=async()=>{
        const { user }=await signInWithGooglePopup();
        const userDocRef=await createUserDocumentFromAuth(user);
    };
    const logGoogleRedirectUser=async()=>{
        const { user }=await signInWithGoogleRedirect();
        console.log(user);
    };
    return (
        <div>
            <h2>Sign in to manage your orders</h2>
            <button onClick={logGoogleUser}>Sign in with Google Popups</button>
            <button onClick={logGoogleRedirectUser}>Sign in with Google Redirect</button>
        </div>
    )
}

export default signIn;
